void save_data(uint64_t val_cycles, uint64_t val_instruction){
	
	FILE *arq;
	
	arq = fopen("saida_cnt.csv", "a");
	
	if(arq == NULL){
		printf("ERROR OPEN FILE");
	}
	
	fprintf(arq, "%"PRIu64";%"PRIu64" \n", val_cycles,val_instruction);
	fclose(arq);
		
}

